			//document.getElementById('divNoSVG').style.display = 'block';
		}
	}
}
catch (e) {
	// Test for Adobe SVG Plugin
	try {
		var oSVG = new ActiveXObject('Adobe.SVGctl'); adobeSVG = true;
	}
	catch (e) {
		//document.getElementById('divNoSVG').style.display = 'block';
